import React from 'react';
import './styles.css';

export const TodoApp = () => {
    return (
        <div>
            <h1>Todo App</h1>
            <hr />

            <ul>
                <li>Comprar una fuente de 750W</li>
                <li>Comprar el Ryzen 5 5600x</li>
                <li>Comprar la RTX 3060 Ti</li>
            </ul>

        </div>
    )
}
